import About from './pages/About';
import Contact from './pages/Contact';
import Home from './pages/Home';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import {useState} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import {Navigate} from 'react-router-dom';

function App(){
  const [stvar, setMess] = useState('');
  const [tfvar, setTF] = useState(true);
  const [tfvarhome, setTFHome] = useState(false);
  const [postdat, setPostMess] = useState('Initial');
  const handleClick = async(paramm) => {
    await axios.post('http://localhost:8080/helphealth123',paramm)
    .then(response => setMess(response.data))
    setTF(tfvar=>!tfvar);
  }
  const homeClick = () => {
    setTFHome(tfvarhome => !tfvarhome);
  }
  const buttonClick = ()=>{
    axios.post('http://localhost:8080/helphealth',window.location.pathname)
    .then(response => setPostMess(response.data));
    console.log(postdat);
  }
  const linksData = [
    { id: 1, text: 'About', to: '/about' },
    { id: 2, text: 'Contact', to: '/contact' },
    ];
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About name = {stvar}/>} />
        <Route path="/contact" element={<Contact name = {stvar}/>} />
      </Routes>
      <nav>
        <ul style={{listStyleType: 'none'}}>
              {tfvarhome && <li>
                <Link to='/' onClick={homeClick}>Home</Link>
              </li>}
              {linksData.map((link) => (
              <li key={link.id}>
                  {tfvar &&<Link to={link.to} onClick = {()=>handleClick(link.to)}>{link.text}</Link>}
              </li>
              ))}
        </ul>
      </nav>
      <button onClick={buttonClick}>Click Me</button>
    </div>
  );
}

export default App
